void draw_start_screen()
{
  int i = 0;
  for(int x = 0; x < 240; x++)
	{
		for(int y = 0; y < 320; y++)
		{
			plot_pixel(y, x, start_screen[i]);
			i++;
		}
	}
  while(!game_start);
  {
    read_buttons();
  }
}

void end_screen()
{
  end_screen_ctr = 0;
    while(game_over)
    {
      read_timer();
      //after 5 seconds clear game over screen
      if(end_screen_ctr >= 300)
      {
        end_screen_ctr = 0;
        game_over = 0;
      }
        if(winner) //if winner == 1, then player won
        {
          draw_win_screen();
        }
        else //if winner == 0, then enemy won
        {
          draw_lose_screen();
        } 
          //draw_start_screen();
    }
    if(!game_start)
    {
      draw_start_screen();
    }
    
}

void base_damage()
{
    if(base_damage_ctr >= 7)
    {
      base_damage_ctr = 0;
      for(int i = 0; i < 100; i++)
      {
          if(cat_tracking[i].x_position == ENEMY_BASE_POS)
          {
              ENEMY_HP -= cat_tracking[i].damage;
          }
          if(dog_tracking[i].x_position == PLAYER_BASE_POS)
          {
              PLAYER_HP -= dog_tracking[i].damage;
          }
      }
    }
    game_complete();
}

/*-------------------------------------------------MAIN-----------------------------------------------*/
//make it so the player gets $25 per second
int main(void)
{
  init_timer();
  *EDGE_CAP = 0b0000; //resets edge cap
  volatile int * pixel_ctrl_ptr = (int *)0xFF203020;

	//point to front buffer
    pixel_plot = *pixel_ctrl_ptr;
	*(pixel_ctrl_ptr) = 1; // turns on double buffering

    pixel_plot = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
	int true = 1, slow_down = 0; //slow down reduces speed of walking 
	//by only incrementing left_shift once every 3 iterations
	vsync();
	int i = 0;
      //player_money = 800;
  while (true == 1)
  { 
		vsync();
	if(draw)
    {
      draw_background();
      draw = 0;
      player_money += 5;
    }
     //increment_money(&player_money);
   // disp_money();

    //draws hp bar over bases
    draw_cat_base_hp();
    draw_dog_base_hp();

    read_buttons();

    //draws "money bar" under each cat
    buy_normal_cat();
    buy_tank_cat();
    buy_axe_cat();
    buy_ninja_cat();
    buy_tall_cat();

    base_damage();
    end_screen();

    //searchs through our cat struct array for all cats that have currently been created
    for(int i = 0; i < 100; i++)
    {
      if(strcmp(cat_tracking[i].type, "normal"))
      {
        draw_normal_cat(&cat_tracking[i]);
      }
      else if(strcmp(cat_tracking[i].type, "tank"))
      {
        draw_tank_cat(&cat_tracking[i]);
      }
      else if(strcmp(cat_tracking[i].type, "axe"))
      {
        draw_axe_cat(&cat_tracking[i]);
      }
      else if(strcmp(cat_tracking[i].type, "ninja"))
      {
        draw_ninja_cat(&cat_tracking[i]);
      }
      else if(strcmp(cat_tracking[i].type, "tall"))
      {
        draw_tall_cat(&cat_tracking[i]);
      }
    }
   
    
    if(slow_down % 4 ==3)
    {
      left_shift--;
    }
    slow_down++; 
  }
}

